import '../styles/Banner.css'

function Banner() {
    return (
        <nav class="navbar">
        <a href="fiche-logement.html"><img src="images/logo.svg" alt="logo"/></a>
        <div class="navbar__link">
            <a href="index.html">Accueil</a>
            <a href="apropos.html">A propos</a>
        </div>
    </nav>
)
}

export default Banner
